import './Home.css';
import Project from '../components/Project';
import { gsap } from 'gsap';
import { ScrollTrigger } from "gsap/ScrollTrigger";
import { useEffect } from 'react';
import SplitType from 'split-type';
import img from '../assets/projects/fireRacoon.png';
import me from '../assets/me.png';

function Home() {

	useEffect(() => {
		window.scrollTo(0, 0);

		const myText = new SplitType('.intro-name');
		const myText2 = new SplitType('#intro-role', { types: 'words' });

		
		const myText4 = new SplitType('.about-p', { types: 'lines', lineClass: 'clipy-about-p clipy' });
		const myText3 = new SplitType('.clipy-about-p ', { types: 'lines', lineClass: 'upsie-line' });

		gsap.to('.char', {
			y: 0,
			stagger: 0.05,
			delay: 0.2,
			duration: .1
		});

		gsap.to(myText2.words, {
			y: 0,
			stagger: 0.05,
			delay: 1,
			duration: .1
		});

		gsap.registerPlugin(ScrollTrigger);

		var upsies = document.querySelectorAll('.upsie');

		upsies.forEach(upsie => {
			var tl = gsap.timeline({
				scrollTrigger: {
					trigger: upsie,
					start: '-50% 95%',
					end: '30% 95%', // total time of scrub animation in px
					scrub: true,
					markers: true
				}
			}).to(upsie, {
				y: 0,
				stagger: 0.05,
				delay: 1,
				duration: .1
			});
		});

		var upsie_lines = document.querySelectorAll('.upsie-line');

		upsie_lines.forEach(upsie => {
			var tl = gsap.timeline({
				scrollTrigger: {
					trigger: upsie,
					start: 'top 95%',
					end: 'bottom 95%', // total time of scrub animation in px
					scrub: true,
					markers: true
				}
			}).to(upsie, {
				y: 0,
				stagger: 0.05,
				delay: 1,
				duration: .1
			});
		});



	});

	const header = (a, b) => {
		return (
			<div className='clipy'>
				<div className='upsie home-header'>
					<h2 className='header-number'>{a}</h2>
					<h2 className='header-title'>{b}</h2>
				</div>
			</div>
		);
	};

	return (
		<div className='Home'>

			<div className='home-section' id='home-intro'>
				<div>
					<div id='intro-words'>
						<div className='clipy intro-name'>AASHNA</div>
						<div className='clipy intro-name'>VERMA</div>
						<div className='clipy' id='intro-role'>- Software engineering student -</div>
					</div>
					<div className='intro-circle'>
						<img src={me} />
						<div className='circle '></div>
					</div>
				</div>
			</div>

			<div className='home-section' id='home-about'>
				{header('./1', 'about me')}
				<p className='about-p'>A dedicated Software Engineering student @ CARLETON UNIVERSITY. constantly creating and learning. Merging creativity with technology to
					create functional and aesthetic systems.</p>
				<p className='about-p'>Outside of coding, you will find me drawing or crocheting something elaborate.</p>
				<div>Skills</div>
				<ul className='about-skills'>
					<li>Front-End Dev</li>
					<li>UI/UX Design</li>
					<li>Algorithms</li>
					<li>Data Structures</li>
				</ul>
				<div>Technologies</div>
				<ul className='about-skills'>
					<li>JavaScript</li>
					<li>HTML/CSS</li>
					<li>ReactJS</li>
					<li>Python</li>
					<li>Java</li>
					<li>Figma</li>
				</ul>
			</div>

			<div className='home-section' id='home-projects'>
				{header('./2', 'recent projects')}
				<Project img={img} title='ColorMe' />
				<Project img={img} title='cuHacking' />
				<Project img={img} title='ColorMe' />
			</div>

			<div id='home-projects'>
				{header('./3', 'contact me')}
			</div>
			<div className='space'></div>
		</div>
	);
}

export default Home;
